import React from 'react';
import SliderItem from "./SliderItem";
import bed0 from  "../assets/images/bed0.png"
import bed1 from  "../assets/images/bed1.png"
import bed2 from  "../assets/images/bed2.png"
import bed3 from  "../assets/images/bed3.png"
import rating from  "../assets/images/rating.png"
const ChairSlider = () => {
    const chairs = [
        {id:0, category: "Bed", img: bed0, title:"Sakarias Bed", rating: rating, price: 392*2},
        {id:1, category: "Bed", img: bed1, title:"Baltsar Bed", rating: rating, price: 299*2},
        {id:2, category: "Bed", img: bed2, title:"Anjay Bed", rating: rating, price: 519*2},
        {id:3, category: "Bed", img: bed3, title:"Nyantuy Bed", rating: rating, price: 921*2},

    ]


    return (
        <div className="product__category">
            {chairs.map((item) =>
                <SliderItem  item = {item}/>
            )}
        </div>
    );
};

export default ChairSlider;
